title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o15183.m10 -> o15219.m21 -> o15183.m28 -> o15219.m21
  o15219.m15 -> o15183.m28 -> o15219.m21 -> o15183.m28
  o15183.m28 -> o15219.m21 -> o15183.m28
  o15219.m21 -> o15183.m28 -> o15219.m21

features:
  - inheritance
  - overriding
  - method
  - polymorphism

